import React from "react";
import { useEffect, useState } from "react";
import Hero from "../components/hero";
import ProductsGrid from "../components/products";
import { fetchProducts, fetchProduct } from "../actions/productActions";
import { useSelector, useDispatch } from "react-redux";
import { Redirect, useHistory } from "react-router-dom";

const Home = () => {
  const dispatch = useDispatch();
  const productsFetched = useSelector(state => state.productsData);
  const productFetched = useSelector(state => state.productsData);
  const { loading, products, error } = productsFetched;
  const { reviews, _id, image } = productFetched;
  useEffect(() => {
    dispatch(fetchProducts());
    dispatch(fetchProduct("5f67e2b0de157e5141b7ae11"));
  }, []);

  console.log(products);
  console.log(_id);
  return (
    <>
      <Hero />
      <ProductsGrid />
      <div>
        <img src={process.env.PUBLIC_URL + "/logo192.png"} />
      </div>
    </>
  );
};

export default Home;
